import React, { Component } from 'react'

export default class Register extends Component {

    constructor(props){
        super(props);
        this.state={
            name:'',
            age:''
        }
    }

    changeName =(e)=>{
        this.setState({name: e.target.value , age: this.state.age})
    }

    changeAge = (e)=>{
        this.setState({name: this.state.name, age: e.target.value})
    }

    addUser = () => {
        this.props.add(this.state.name , this.state.age)
    }

    render() {
        return (
            <div>
                <input type='text' onChange={this.changeName}/>
                <input type='text' onChange={this.changeAge}/>
                <button onClick={this.addUser}>add user</button>
            </div>
        )
    }
}
